func TestSign(t *testing.T) {
	var seed Trytes = "WQNZOHUT99PWKEBFSKQSYNC9XHT9GEBMOSJAQDQAXPEZPJNDIUB9TSNWVMHKWICW9WVZXSMDFGISOD9FZ"
	var bundleHash Trytes = "CDMEKHAJFKDZPPUSQWALZNFSDDRPQDEFSPUSHLSUDWWVLXYZJIG9XHVRFJZHFSMSXS9ZPQHLF9WTYBWDW"
	var csign0 Trytes = ""
	var csign1 Trytes = ""

	key, err := NewPrivateKey(seed, 0, 2)
	if err != nil {
		t.Fatalf("NewPrivateKey(): %#v", err)
	}

	norm := Normalize(bundleHash)
	sign0, err := Sign(norm[:27], key[:SignatureSize/3])
	if err != nil {
		t.Fatalf("Sign(): %#v", err)
	}
	if sign0 != csign0 {
		t.Error("sig is incorrect.")
	}

	sign1, err := Sign(norm[27:54], key[SignatureSize/3:SignatureSize*2/3])
	if err != nil {
		t.Fatalf("Sign(): %#v", err)
	}
	if sign1 != csign1 {
		t.Error("sig is incorrect.")
	}

	adr, err := NewAddressHash(Address{seed, 0, 2})
	if err != nil {
		t.Fatal(err)
	}

	if !IsValidSig(adr, []Trytes{sign0, sign1}, bundleHash) {
		t.Error("cannot validate signature.")
	}

}

func TestNewSubseed(t *testing.T) {
	var subseedTestSeed = "999999999999999999999999999999999999999999999999999999999999999999999999999999999"
	var subseedTestSeedExpect = "9NGBYIGJTUTYPACOHYWUGLWO9OASWBNWCIADXRWRSZPOSRYJTHDANSCVG9KULYERRBPBPLZHA9BEONKZW"
	subseed, err := NewSubseed(Trytes(subseedTestSeed), 0)
	if err != nil {
		t.Fatal(err)
	}

	subseedTrytes := MustTritsToTrytes(subseed)
	if subseedTrytes != subseedTestSeedExpect {
		t.Fatalf("epxected subseed to be %s but was %s", subseedTestSeedExpect, subseedTrytes)
	}
}
